#define DISPATCH_VOID( cord, dtype, fname, ...) \
	PushCallStack( "Matrix::" #fname ); \
	switch ( dtype.DataType() ) { \
	default: throw std::logic_error( "Not implemented for this data type" ); break; \
	case SINGLE:   CAST_ ## cord(fname,float,__VA_ARGS__); break; \
	case DOUBLE:   CAST_ ## cord(fname,double,__VA_ARGS__); break; \
	case SCOMPLEX: CAST_ ## cord(fname,scomplex,__VA_ARGS__); break; \
	case DCOMPLEX: CAST_ ## cord(fname,dcomplex,__VA_ARGS__); break; \
	} \
	PopCallStack();
#define DISPATCH_SCALAR( cord, dtype, fname, ...) \
	S ans; \
	PushCallStack( "Matrix::" #fname ); \
	switch ( dtype.DataType() ) { \
	default: throw std::logic_error( "Not implemented for this data type" ); break; \
	case SINGLE:   ans = CAST_ ## cord(fname,float,__VA_ARGS__); break; \
	case DOUBLE:   ans = CAST_ ## cord(fname,double,__VA_ARGS__); break; \
	case SCOMPLEX: ans = CAST_ ## cord(fname,scomplex,__VA_ARGS__); break; \
	case DCOMPLEX: ans = CAST_ ## cord(fname,dcomplex,__VA_ARGS__); break; \
	} \
	PopCallStack(); \
	return ans;
	
